import React, { useState, useEffect } from "react";
import { Card, Col, Container, Form, Row, Button } from "react-bootstrap";
import useChofer from "hooks/useChofer";

const objnew = {
  pk: null,
  nombre: "",
  ci: "",
  url: "",
  create_by: Number(1),
  members: [],
};

const FormChoferes = ({
  dataToEdit,
  setdataToEdit,
  setModalClose,
  create,
  update,
}) => {
  const { form, errores, handleChange, handleSubmit, handleBlur, handleReset } =
    useChofer(objnew, dataToEdit, setdataToEdit, setModalClose, create, update);

  return (
    <>
      <Container>
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col className="px-1 col col-md-12">
              <Form.Group>
                <label htmlFor="nombre del Chofer">Nombre del Chofer</label>
                <Form.Control
                  placeholder="Nombre del Chofer."
                  type="text"
                  name="nombre"
                  value={form.nombre}
                  onChange={handleChange}
                  onBlur={handleBlur}
                ></Form.Control>
              </Form.Group>
              {}
            </Col>
          </Row>
          <Row>
            <Col className="px-1 col col-md-12">
              <Form.Group>
                <label htmlFor="nombre del Chofer">CI del Chofer</label>
                <Form.Control
                  placeholder="Nombre del Chofer."
                  type="text"
                  value={form.ci}
                  name="ci"
                  onChange={handleChange}
                  onBlur={handleBlur}
                ></Form.Control>
              </Form.Group>
            </Col>
          </Row>
          <Row>
            <Button
              //style={{ marginLeft: "300px" }}
              className="btn-fill ml-auto mr-2"
              variant="danger"
              onClick={handleReset}
            >
              Cancelar
            </Button>
            <Button
              className="btn-fill pull-right"
              type="submit"
              variant="info"
            >
              Acceptar
            </Button>
          </Row>
        </Form>
      </Container>
    </>
  );
};

export default FormChoferes;
